INSERT INTO `notification_template_content_mapping` (`id`, `template_id`, `language`, `template_detail`, `subject`, `notification_message`, `notification_link`, `status`, `created_by`, `updated_by`, `deleted_by`, `created_at`, `updated_at`, `deleted_at`, `user_type`, `mail_template_detail`, `mail_subject`) VALUES
(44, 14, 'en', '<p>Dear [[ admin_name ]],<br /><br /> We are pleased to inform you that your appointment has been successfully confirmed with [[ company_name ]]! Thank you for choosing us &ndash; we are excited to serve you and ensure you and your pet have a fantastic experience. <br /><br />Here are the details of your appointment: <br /><br />üìÖ Appointment Details: <br />- Appointment ID: #[[ booking_id ]] - Service/Event: [[ booking_services_names ]]<br />- Date: [[ booking_date ]] <br />- Time: [[ booking_time ]] <br />- Location: [[ venue_address ]] <br /><br />We&rsquo;ve received your appointment and everything is set. Our team is preparing to deliver an amazing service, and we want to make sure all your expectations are met. If you have any questions or specific requests, feel free to reach out to us. <br /><br />Tip: Don\'t forget to mark your calendar and set a reminder for your appointment! <br /><br />We appreciate your trust in us and look forward to providing top-notch service. For any further queries, our customer support team is here to assist you.<br /><br />Best regards,<br />[[ logged_in_user_fullname ]], <br />[[ logged_in_user_role ]],<br />[[ company_name ]]</p>', 'New Booking Received.', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'admin', '<p>New booking received: ID #[[ booking_id ]] by [[ user_name ]]. Check the details on your dashboard.</p>', 'New Booking Received'),
(45, 14, 'en', '<p>Dear [[ admin_name ]],<br /><br /> We are pleased to inform you that your appointment has been successfully confirmed with [[ company_name ]]! Thank you for choosing us &ndash; we are excited to serve you and ensure you and your pet have a fantastic experience. <br /><br />Here are the details of your appointment: <br /><br />üìÖ Appointment Details: <br />- Appointment ID: #[[ booking_id ]] - Service/Event: [[ booking_services_names ]]<br />- Date: [[ booking_date ]] <br />- Time: [[ booking_time ]] <br />- Location: [[ venue_address ]] <br /><br />We&rsquo;ve received your appointment and everything is set. Our team is preparing to deliver an amazing service, and we want to make sure all your expectations are met. If you have any questions or specific requests, feel free to reach out to us. <br /><br />Tip: Don\'t forget to mark your calendar and set a reminder for your appointment! <br /><br />We appreciate your trust in us and look forward to providing top-notch service. For any further queries, our customer support team is here to assist you.<br /><br />Best regards,<br />[[ logged_in_user_fullname ]], <br />[[ logged_in_user_role ]],<br />[[ company_name ]]</p>', 'New Booking Received.', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'demo_admin', '<p>New booking received: ID #[[ booking_id ]] by [[ user_name ]]. Check the details on your dashboard.</p>', 'New Booking Received'),
(46, 14, 'en', '<p>Hello [[ employee_name ]],<br /><br /> You have been assigned a new booking scheduled for [[ booking_date ]] at [[ booking_time ]]. <br /><br />üìã Booking Details: <br />- Booking ID: #[[ booking_id ]] <br />- Customer Name: [[ user_name ]] <br />- Services: [[ booking_services_names ]] <br />- Duration: [[ booking_duration ]] <br />- Address: [[ venue_address ]] <br /><br /> Please prepare accordingly and confirm the booking in your dashboard. <br /><br /> Regards, <br /> [[ company_name ]]</p>', 'New Booking Assigned.', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'employee', 'New booking assigned to you: ID #[[ booking_id ]]. Check schedule for [[ booking_date ]] at [[ booking_time ]].', 'New Booking Assigned'),
(47, 14, 'en', '<p>Hello [[ user_name ]],<br /><br /> Thank you for choosing [[ company_name ]] for your pet care needs! Your booking has been confirmed. <br /><br /> üìã Booking Details:<br /> - Booking ID: #[[ booking_id ]] <br />- Date &amp; Time: [[ booking_date ]] at [[ booking_time ]] <br />- Services: [[ booking_services_names ]] <br />- Duration: [[ booking_duration ]] <br />- Assigned Staff: [[ employee_name ]] <br />- Address: [[ venue_address ]] If you have any questions, please reach out to us. <br /><br /> Thank you, <br /> [[ company_name ]]</p>', 'Your Booking Confirmation', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'user', '<p>Your booking (ID #[[ booking_id ]]) is confirmed for [[ booking_date ]] at [[ booking_time ]]. Details sent to your email.</p>', 'Your Booking Confirmation'),
(48, 15, 'en', '<p>Dear [[ user_name ]],<br /><br /> Your booking has been successfully accepted! We\'re excited to welcome you and hope you enjoy your time with us. <br /><br /> Booking Details: <br />- Booking ID: #[[ booking_id ]]<br />- Booking Date: [[ booking_date ]] <br />- Booking Time: [[ booking_time ]] <br /><br /> We look forward to hosting you and ensuring you have a pleasant experience. If you have any questions or need assistance, don\'t hesitate to reach out to us. <br /><br /> Best regards, <br /> The [[ company_name ]] Team <br /> Contact: [[ company_contact_info ]]</p>\n            ', 'Booking Confirmed', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'user', '<p dir=\"ltr\">Your booking is confirmed! Booking ID: #[[ booking_id ]]. Check your email for full details.</p>', 'Booking Confirmed'),
(49, 15, 'en', '<p>Dear [[ admin_name ]], <br /><br /> A new booking has been accepted! Please review the details below. <br /><br /> Booking Details: <br /><br />- Booking ID: #[[ booking_id ]] <br />- User Name: [[ user_name ]] <br />- Booking Date: [[ booking_date ]] <br />- Booking Time: [[ booking_time ]] <br /><br /> If you need further details or assistance, please contact us. <br /><br /> Best regards, <br /> The [[ company_name ]] Team <br /> Contact: [[ company_contact_info ]]</p>\n<p><span style=\"font-family: Arial; font-size: 13px; white-space-collapse: preserve;\">&nbsp;</span></p>\n            ', 'New Booking Accepted', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'admin', '\n           <p dir=\"ltr\">New booking accepted: ID #[[ booking_id ]] from [[ user_name ]]. Review the details in your admin panel.</p>', 'New Booking Accepted'),
(50, 15, 'en', '\n               <p>Dear [[ admin_name ]], <br /><br /> A new booking has been accepted! Please review the details below. <br /><br /> Booking Details: <br /><br />- Booking ID: #[[ booking_id ]] <br />- User Name: [[ user_name ]] <br />- Booking Date: [[ booking_date ]] <br />- Booking Time: [[ booking_time ]] <br /><br /> If you need further details or assistance, please contact us. <br /><br /> Best regards, <br /> The [[ company_name ]] Team <br /> Contact: [[ company_contact_info ]]</p>\n<p><span style=\"font-family: Arial; font-size: 13px; white-space-collapse: preserve;\">&nbsp;</span></p>\n            ', 'New Booking Accepted', 'A booking has been accepted.', '', 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'demo_admin', '\n           <p dir=\"ltr\">New booking accepted: ID #[[ booking_id ]] from [[ user_name ]]. Review the details in your admin panel.</p>', 'New Booking Accepted'),
(51, 16, 'en', '\n                <p>Dear [[ user_name ]], <br /><br /> We regret to inform you that your booking has been rejected. We sincerely apologize for any inconvenience caused. <br /><br /> Booking Details:<br />- Booking ID: #[[ booking_id ]]<br /> - Service: [[ booking_services_names ]] <br />- Date: [[ booking_date ]] <br />- Time: [[ booking_time ]] <br />- Location: [[ venue_address ]] <br /><br /> If you have any questions or need assistance, please do not hesitate to contact us. <br /><br /> Best regards, <br /> The [[ company_name ]] <br />Team Contact: [[ company_contact_info ]]</p>\n\n            ', 'Booking Rejected', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'user', '<p dir=\"ltr\">We regret to inform you that your booking #[[ booking_id ]] has been rejected. Please check your email for details.</p>', 'Booking Rejected'),
(52, 16, 'en', '\n               <p>Dear [[ admin_name ]],<br /><br /> A booking has been rejected. Please review the details and take any necessary actions.</p>\n\n            ', 'Booking Rejected', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'admin', '<p>Booking #[[ booking_id ]] has been rejected. Please review the details in your admin panel.</p>', 'Booking Rejected'),
(53, 16, 'en', '\n               <p>Dear [[ admin_name ]],<br /><br /> A booking has been rejected. Please review the details and take any necessary actions.</p>\n\n            ', 'Booking Rejected', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'demo_admin', '<p>Booking #[[ booking_id ]] has been rejected. Please review the details in your admin panel.</p>', 'Booking Rejected'),
(54, 17, 'en', '<p>Dear [[ user_name ]],</p>\n<p>Congratulations! Your booking has been successfully completed. We sincerely appreciate your business and hope you had a wonderful experience with us.</p>\n<p>Booking Date: [[ booking_date ]]</p>\n<p>Service Provided: [[ booking_services_names ]]</p>\n<p>We look forward to serving you again in the future. If you have any feedback or need further assistance, please do not hesitate to contact us.</p>\n<p>Best regards,</p>\n<p>[[ company_name ]]</p>\n<p>[[ company_contact_info ]]</p>\n            ', 'Booking Complete', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'user', '<p>Your booking #[[ booking_id ]] for [[ booking_services_names ]] on [[ booking_date ]] is complete. We hope you had a great experience!</p>', 'Booking Complete'),
(55, 17, 'en', '\n            <p>Dear [[ user_name ]], <br /><br /> We regret to inform you that your booking has been rejected. We sincerely apologize for any inconvenience caused. <br /><br /> Booking Details: <br />- Booking ID: #[[ booking_id ]] <br />- Service: [[ booking_services_names ]] <br />- Date: [[ booking_date ]] <br />- Time: [[ booking_time ]] <br />- Location: [[ venue_address ]] <br /><br /> If you have any questions or need assistance, please do not hesitate to contact us. <br /><br />Best regards, <br /> The [[ company_name ]] Team <br /> Contact: [[ company_contact_info ]]</p>\n          ', 'Booking Completed Successfully', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'admin', '<p>We regret to inform you that your booking #[[ booking_id ]] has been rejected. Please check your email for details.</p>', 'Booking Completed Successfully'),
(56, 17, 'en', '\n            <p>Dear [[ user_name ]], <br /><br /> We regret to inform you that your booking has been rejected. We sincerely apologize for any inconvenience caused. <br /><br /> Booking Details: <br />- Booking ID: #[[ booking_id ]] <br />- Service: [[ booking_services_names ]] <br />- Date: [[ booking_date ]] <br />- Time: [[ booking_time ]] <br />- Location: [[ venue_address ]] <br /><br /> If you have any questions or need assistance, please do not hesitate to contact us. <br /><br />Best regards, <br /> The [[ company_name ]] Team <br /> Contact: [[ company_contact_info ]]</p>\n          ', 'Booking Completed Successfully', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'demo_admin', '<p>We regret to inform you that your booking #[[ booking_id ]] has been rejected. Please check your email for details.</p>', 'Booking Completed Successfully'),
(57, 18, 'en', '<p>Dear [[ user_name ]], <br /><br /> We regret to inform you that your booking has been cancelled. We apologize for any inconvenience this may have caused.</p>\n            <p>Booking Details: <br />- Booking ID: #[[ booking_id ]] <br />- Service: [[ booking_services_names ]] <br />- Date: [[ booking_date ]] <br />- Time: [[ booking_time ]] <br />- Location: [[ venue_address ]] <br /><br /> If you have any questions or need further assistance, please do not hesitate to contact us. We are here to help! <br /><br /> Best regards, <br /> The [[ company_name ]] Team <br /> Contact: [[ company_contact_info ]]</p>', 'Your Booking Has Been Cancelled', NULL, NULL, 1, NULL, NULL, NULL, '2024-12-20 08:48:15', '2024-12-20 08:48:15', NULL, 'user', '<p>Your booking #[[ booking_id ]] for [[ booking_services_names ]] on [[ booking_date ]] has been cancelled. Please contact us for further assistance.</p>', 'Your Booking Has Been Cancelled'),
