(1, 'Sojoss Simply Beef Freeze-Dried Dog Treats, 4-oz bag', 'sojoss-simply-beef-freeze-dried-dog-treats-4-oz-bag-tgtvr', 'Bite Sized Treat, Big sized Flavor: Simply Beef is 100% raw', '<p>Bite Sized Treat, Big sized Flavor: Simply Beef is 100% raw, freeze dried meat is the healthy and flavorful way to train your pup, or simply reward him for being the best dog ever; it‚Äôs the perfect treat for every occasion.</p>', 1, 1, NULL, 20, 20, 0, 'percent', 1695168000, 1695168000, NULL, 22, 1, 1, 0, 0, 1, 1, 8, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 06:48:47', '2024-12-20 08:51:26', NULL),
(2, 'Droools Adult Wet Dog Food, Real Chicken And Chicken Liver Chunks In Gravy', 'droools-adult-wet-dog-food-real-chicken-and-chicken-liver-chunks-in-gravy-5w3ot', NULL, '<p> A nutritious food that supports your pet\'s joint health.</p><p>Complete Meat, Serve Solo or Mix with Dry Kibble and feed.</p><p>Perfect meal which supports Dogs brain &amp; eye development.</p><p>Real Chicken, Liver and Eggs Keeps your pet active and agile all day.</p><p>Loaf in gravy, which provides all the nutrients required for a healthy life.</p>', 2, 1, NULL, 30, 50, 0, 'percent', 1695168000, 1695168000, NULL, 14, 1, 1, 0, 0, 1, 1, 0, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 06:56:30', '2023-09-20 07:24:07', NULL),
(3, 'Loveeabowl Grain Free Chicken & Snow Crab Cat Dry Food', 'loveeabowl-grain-free-chicken-snow-crab-cat-dry-food-dxesw', NULL, '<p> Promotes healthy bones and ideal for cats with allergies</p>', 3, 2, NULL, 40, 55, 0, 'percent', 1695168000, 1695168000, NULL, 11, 1, 1, 0, 0, 1, 1, 0, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 07:05:17', '2023-09-20 07:23:05', NULL),
(4, 'HUFFT Cat Mahi Mahi Fish Crunchies', 'hufft-cat-mahi-mahi-fish-crunchies-mctht', NULL, '<p> Dehydrated, slow-cooked, gluten-free cat treats</p>', 4, 1, NULL, 10, 25, 0, 'percent', NULL, NULL, 0, 20, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:18:03', '2023-09-20 07:18:03', NULL),
(5, 'Pureepet Mackerel Adult Cat Dry Food', 'pureepet-mackerel-adult-cat-dry-food-u8qbt', NULL, '<p> Purepet Mackerel Adult Cat food is formulated with essential ingredients to provide overall wellness to your Cat. Enriched with Mackerel and other essential ingredients helps your feline to maintain a beautiful skin and coat. Taurine, an essential amino acid that keeps heart healthy and promotes growth and development. It is highly palatable and easy to digest.</p>', 5, 1, NULL, 99, 199, 0, 'percent', NULL, NULL, 0, 22, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:21:46', '2023-09-20 07:21:49', NULL),
(6, 'Feekoo Pet Heating Pad,Large Electric Heating Pad for Dogs and Cats Indoor Adjustable Warming Mat', 'feekoo-pet-heating-padlarge-electric-heating-pad-for-dogs-and-cats-indoor-adjustable-warming-mat-k5rfp', NULL, '<p>Heating Pad with Timer and Auto Power Off: BurgeonNest heating pad for dog has 5 timer option - Always(default setting),4H, 8H, 12H, 24H and adjustable comfortable temperature setting( 86-131/30-55). Equipped with upgrade thermostats, such pet heating pad can precisely control temperature and will be powered off after arrives the setting time</p>', 6, NULL, NULL, 56, 56, 0, 'percent', NULL, NULL, 0, 25, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:31:03', '2023-09-20 07:31:03', NULL),
(7, 'BirdiesNature All Natural Enriching Treats for Large Birds (Ranch Mix)', 'birdiesnature-all-natural-enriching-treats-for-large-birds-ranch-mix-zrkxi', NULL, '<p>BirdsNature understands that sharing your life with a small pet is not only enjoyable but very enriching. BirdsNature shows our love by ensuring we provide your small pet with the best nutrition for a long and healthy life. it‚Äôs no wonder why BirdsNature is at the heart of every healthy feeding routine. </p>', 7, 1, NULL, 29, 59, 0, 'percent', NULL, NULL, 0, 22, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:35:28', '2023-09-20 22:38:14', NULL),
