(4, 'play-areas', 'Play Areas', 'Designated areas or play yards where pets can exercise and interact with other compatible animals.', 1, 1, 1, NULL, '2024-12-20 08:48:03', '2024-12-20 08:48:03', NULL),
(5, 'private-suites', 'Private Suites', 'Offer private, comfortable rooms or suites for pets who prefer more solitude and a quiet environment.', 1, 1, 1, NULL, '2024-12-20 08:48:03', '2024-12-20 08:48:03', NULL),
